import React, { useEffect, useState } from "react";
import axios from "axios";
import { useNavigate } from "react-router-dom";

const Home = () => {
  const [events, setEvents] = useState([]);
  const [message, setMessage] = useState("");
  const [type, setType] = useState("");

  const token = localStorage.getItem("token");
  const navigate = useNavigate();

  useEffect(() => {
    fetchEvents();
  }, []);

  const showMessage = (msg, msgType = "error") => {
    setMessage(msg);
    setType(msgType);
    setTimeout(() => setMessage(""), 2500);
  };

  const fetchEvents = async () => {
    try {
      const res = await axios.get("http://localhost:5000/event/allevents");
      setEvents(res.data);
    } catch {
      showMessage("Failed to load events");
    }
  };

  const registerEvent = async (eventId) => {
    try {
      const res = await axios.post(
        "http://localhost:5000/event/registerevent",
        { eventId },
        { headers: { Authorization: `Bearer ${token}` } }
      );
      showMessage(res.data.message, "success");
    } catch {
      showMessage("Registration failed");
    }
  };

  const logout = () => {
    localStorage.removeItem("token");
    navigate("/login");
  };

  return (
    <div className="min-h-screen bg-gray-50">
      {/* TOP BAR */}
      <div className="bg-white border-b">
        <div className="max-w-7xl mx-auto px-6 py-4 flex justify-between items-center">
          <h1 className="text-xl font-semibold text-gray-800">
            EventHub
          </h1>
          <button
            onClick={logout}
            className="text-sm text-red-600 hover:underline"
          >
            Logout
          </button>
        </div>
      </div>

      {/* HERO SECTION */}
      <div className="bg-blue-600 text-white">
        <div className="max-w-7xl mx-auto px-6 py-16">
          <h2 className="text-3xl font-bold mb-2">
            Discover & Join Events
          </h2>
          <p className="text-blue-100 max-w-xl">
            Explore upcoming events and register instantly using our
            real-time event management platform.
          </p>
        </div>
      </div>

      {/* CONTENT */}
      <div className="max-w-7xl mx-auto px-6 py-10">
        {/* MESSAGE */}
        {message && (
          <div
            className={`mb-6 px-4 py-2 rounded text-sm inline-block ${
              type === "success"
                ? "bg-green-100 text-green-700"
                : "bg-red-100 text-red-700"
            }`}
          >
            {message}
          </div>
        )}

        <h3 className="text-xl font-semibold mb-6 text-gray-800">
          Upcoming Events
        </h3>

        {/* EVENTS */}
        <div className="grid sm:grid-cols-2 lg:grid-cols-3 gap-8">
          {events.map((event) => (
            <div
              key={event._id}
              className="bg-white rounded-xl border overflow-hidden hover:shadow-lg transition"
            >
              {/* FAKE IMAGE HEADER (NO IMAGE FILE NEEDED) */}
              <div className="h-28 bg-gradient-to-r from-blue-500 to-blue-700"></div>

              <div className="p-5">
                <h4 className="text-lg font-semibold text-gray-800 mb-1">
                  {event.title}
                </h4>

                <p className="text-sm text-gray-600 mb-3 line-clamp-2">
                  {event.description}
                </p>

                <div className="text-sm text-gray-500 space-y-1 mb-4">
                  <p>üìÖ {event.date}</p>
                  <p>‚è∞ {event.time}</p>
                  <p>üìç {event.location}</p>
                </div>

                <button
                  onClick={() => registerEvent(event._id)}
                  className="w-full bg-blue-600 text-white py-2 rounded-lg hover:bg-blue-700 transition"
                >
                  Register
                </button>
              </div>
            </div>
          ))}
        </div>

        {events.length === 0 && (
          <p className="text-center text-gray-500 mt-16">
            No events available
          </p>
        )}
      </div>
    </div>
  );
};

export default Home;
